import React from 'react'
import { DinnerList } from '../helpers/DinnerList';
import DinnerItem from '../components/DinnerItem';
import '../styles/Home.css';

function Home() {
  return (
    <div>
    {DinnerList.map((dinnerItem, key) => {
        return (
            <DinnerItem 
            key={key}
            image={dinnerItem.image}
            name={dinnerItem.name}
            price={dinnerItem.price}
            ingredients={dinnerItem.ingredients}
            instructions={dinnerItem.instructions}
        />
        );
    })}
    </div>
  )
}

export default Home
